import './popup.scss';

const Popup = (props) => {
  // const [show, setShow] = useState(true);
  // useEffect(()=>{
    setTimeout(()=>{
      setShow(true)
    }, 2000)
  // }, [])
  return (props.trigger) ? (
    <div className="pop-up">
      <div className="pop-up_inner">
        <button className="close" onClick={() => props.setTrigger(false)}>X</button>
        <div>my popup</div>
      </div>
    </div>
  ) : ""
} 

export default Popup;
